import React from "react";

const AddProducts = () => {
  return (
    <header>
      <nav>
        <input type="checkbox" id="check" />
        <label for="check" class="checkbtn">
          <i class="bi bi-list"></i>
        </label>
      </nav>
    </header>
  );
};

export default AddProducts;
